INSERT INTO `indikator_formula` VALUES (1, 1, '{\"A1\":\"=(H14+H20+H26+H34)/4\"}', '{\"H14\":\"Indeks Ketersediaan Hulu Migas\", \"H20\":\"Indeks Ketersediaan BBM\", \"H26\":\"Indeks Ketersediaan LPG\", \"H34\":\"Indeks Ketersediaan LNG\"}', '{\"A1\":\"=IF(G4>1.3,1-ABS((G4-1.3)/1.3),IF(G4>1,FORECAST(G4,OFFSET($BQ$5:$BQ$7,MATCH(G4,$BP$5:$BP$7,1)-1,0,2),OFFSET($BP$5:$BP$7,MATCH(G4,$BP$5:$BP$7,1)-1,0,2)),(G4/$F$4)))\", \"BP5\":\"1.00\", \"BP6\":\"1.15\", \"BP7\":\"1.30\", \"BQ5\":\"1\", \"BQ6\":\"1.1\", \"BQ7\":\"1.2\"}', '{\"G4\":\"realisasi\", \"F4\":\"target\"}');
INSERT INTO `indikator_formula` VALUES (2, 2, '{\"A1\":\"=H15\",\"H15\":\"=(H9+H14)/2\",\"H9\":\"=(H4+H5-H6)/H7\",\"H14\":\"=H11/H12\",\"H10\":\"=(E10*C16)+G10\",\"H11\":\"=H10*1.027\",\"H12\":\"=(E12*C16)+G12\",\"C16\":\"=IF(B16=1,90,IF(B16=2,91,IF(B16=3,92,92)))\"}', '{\"H4\":\"Realisasi Produksi/Lifting Minyak\",\"H5\":\"Realisasi Impor Minyak Mentah\",\"H6\":\"Realisasi Ekspor Minyak Mentah\",\"H7\":\"Kebutuhan Kilang Minyak\",\"E10\":\"Realisasi Produksi/Lifting Gas Bumi MMSCF\",\"G10\":\"Realisasi Produksi/Lifting Gas Bumi MMSCF Terdahulu\",\"E12\":\"Realisasi Alokasi Gas Dom\",\"G12\":\"Realisasi Alokasi Gas Dom Terdahulu\",\"B16\":\"Triwulan\"}', '{\"A1\": \"=E5\",\"E5\":\"=IF(G5<1,G5/F5,IF(1<=G5<1.2,1+(ABS((G5-F5)/F5)),120%))\"}', '{\"G5\":\"realisasi\", \"F5\":\"target\"}');
INSERT INTO `indikator_formula` VALUES (3, 3, '{\"A1\":\"=G7+G8\"}', '{\"G7\":\"Produksi Minyak Bumi\", \"G8\":\"Produksi Gas Bumi\"}', '{\"A1\":\"=G6/F6\"}', '{\"G6\":\"realisasi\",\"F6\":\"target\"}');
INSERT INTO `indikator_formula` VALUES (5, 4, '{\"A1\":\"=(E5)/(E6)\"}', '{\"E5\":\"Realisasi Produksi/Lifting Minyak\", \"E6\":\"Paramater TW2 181000\"}', '{\"A1\":\"=G7/F7\"}', '{\"G7\":\"realisasi\", \"F7\":\"target\"}');
INSERT INTO `indikator_formula` VALUES (6, 5, '{\"A1\":\"=(E11/E12)\"}', '{\"E11\":\"Realisasi Produksi/Lifting Gas Bumi\", \"E12\":\"Parameter 5658\"}', '{\"A1\":\"=G8/F8\"}', '{\"G8\":\"realisasi\", \"F8\":\"target\"}');
INSERT INTO `indikator_formula` VALUES (7, 9, '{\"A1\":\"=E24/C24\", \"E24\":\"=C24-D24\"}', '{\"C24\":\"Kuota per surat rekomendasi (bbl)\", \"D24\":\"Realisasi per TW (bbl)\"}', '{\"A1\":\"=FORECAST(F24,OFFSET($BB$5:$BB$7,MATCH(F24,$BA$5:$BA$7,1)-1,0,2),OFFSET($BA$5:$BA$7,MATCH(F24,$BA$5:$BA$7,1)-1,0,2))\", \"BA5\":\"0\", \"BA6\":\"0.15\", \"BA7\":\"1\", \"BB5\":\"1.2\", \"BB6\":\"1\", \"BB7\":\"0\"}', '{\"F24\":\"realisasi\"}');
