INSERT INTO `indikator_formula` VALUES (10, 12, '{\"A1\":\"=E33/C33\",\"E33\":\"=C33-D33\"}', '{\"C33\":\"kuota per surat rekomendasi (MMBTU)\",\"D33\":\"realisasi per TW (MMBTU)\"}', '{\"A1\":\"=FORECAST(F33,OFFSET($BB$5:$BB$7,MATCH(F33,$BA$5:$BA$7,1)-1,0,2),OFFSET($BA$5:$BA$7,MATCH(F33,$BA$5:$BA$7,1)-1,0,2))\", \"BA5\":\"0\",\"BA6\":\"0.15\",\"BA7\":\"1\", \"BB5\":\"1.2\",\"BB6\":\"1\",\"BB7\":\"0\"}', '{\"F33\":\"target\"}');
